import React from 'react'

const Footer = () => {
    return (
        <div className='bg-gray-900 p-4'>
            <div className='container mx-auto text-center font-normal text-white'>&copy;{' '} 2020 MeConta: {' '} <br/>
            <a className='hover:underline font-bold' >EOS CREATIVE TECHNOLOGIE</a>
            </div>
        </div>
    )
}
export default Footer
